import React from 'react'

import { deleteNavItem } from '../navBarList/navBarSlice'

const NavBarItem = (props) => {
  return (
    <div className='navBarItem'>
        <button className='navBarItemBinBtn'></button>
        <label className='navBarItemLabel'></label>
    </div>
  )
}

export default NavBarItem
